import { Block } from "galio-framework";
import { Easing, Animated, Dimensions } from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

// screens
import Login from '../screens/Register';
import Home from '../screens/Home';

import CategoryMRIR from '../screens/Category/Category_mrir';
import CategoryVT from '../screens/Category/Category_vt';

// ============================ MV ===============================
import MVCategory from '../screens/MV/MVCategory';
import MVSurveyorList from '../screens/MV/Surveyor/MVSurveyorList';
import MVSurveyorListDetail from '../screens/MV/Surveyor/MVSurveyorListDetail';
