import WorkpackJointVTSubmission from '../screens/Workpack/WorkpackJointVTSubmission';
import WorkpackList from '../screens/Workpack/WorkpackList';
import WorkpackDetail from '../screens/Workpack/WorkpackDetail';
// ===============================================================

// ========================== I Y M ==============================
  import Add from '../screens/Add';
  import Update from '../screens/Update';
  import DetailIssue from '../screens/DetailIssue'; 
// ===============================================================

import Camera from '../screens/Camera/Camera';

